INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Wysyłka','','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<p><span style=\"font-size:14px;\"><strong>CZAS REALIZACJI</strong></span></p>\n<p><span style=\"font-size:14px;\">Zamówienia są realizowane jak tylko odnotowujemy należność za zamówiony towar na naszym koncie. Średni czas oczekiwania na realizację zamówienia to 2 dni robocze dla produktów dostępnych \"od ręki\". Średni czas oczekiwania na realizację zamówienia dla produktów wytwarzanych przez nas (np. wszystkie produkty Cottonmix Cake) to 7 dni roboczych. Gdyby wystąpiły jakiekolwiek trudności z realizacją zamówienia zostaną Państwo o tym poinformowani mailowo lub telefonicznie.</span></p>\n<p><span style=\"font-size:14px;\"><strong>DOSTAWA</strong></span></p>\n<p><span style=\"font-size:14px;\">Zamówiony towar dostarczamy za pośrednictwem firmy kurierskiej InPost lub Poczty Polskiej. Koszty wysyłki naliczane są<strong> automatycznie niezależnie od wagi zamówienia</strong> i pojawią się w podsumowaniu koszyka zakupów wraz z wyszczególnioną wysyłką. Należy wybrać jedynie jedną z form:</span></p>\n<p style=\"margin-left:40px;\"><span style=\"font-size:14px;\"><strong>- przesyłka POCZTA POLSKA</strong></span></p>\n<p style=\"margin-left:40px;\"><span style=\"font-size:14px;\"><strong>- przesyłka paczkomat INPOST </strong></span></p>\n<p style=\"margin-left:40px;\"><span style=\"font-size:14px;\"><strong>- przesyłka KURIERSKA INPOST </strong></span></p>\n<p style=\"margin-left:40px;\"><span style=\"font-size:14px;\"><strong>- odbiór osobisty. </strong></span></p>\n<p><span style=\"font-size:14px;\"><u>Mają Państwo do wyboru następujące formy dostawy na terenie Polski:</u></span></p>\n<p><span style=\"font-size:14px;\"><strong><span style=\"background-color:#ffffff;\">1. Paczka POCZTY POLSKIEJ</span> </strong>niezależnie od wagi:</span></p>\n<p style=\"margin-left:40px;\"><span style=\"font-size:14px;\"><strong>a)</strong> paczka pocztowa <strong> – 14 zł </strong></span></p>\n<p><strong><span style=\"font-size:14px;\">2. Przesyłka do paczkomatu INPOST - 16 zł</span></strong></p>\n<p style=\"text-align:left;\"><strong><span style=\"font-size:14px;\">3. Przesyłka KURIERSKA po przedpłacie na konto – 18 zł</span></strong></p>\n<p style=\"text-align:left;\"><span style=\"font-size:14px;\"><strong>4. Wysyłka za pobraniem<strong> - </strong></strong>za zakupy zapłacisz przy odbiorze listonoszowi lub kurierowi.</span></p>\n<p style=\"margin-left:40px;text-align:left;\"><strong><span style=\"font-size:14px;\">b) przesyłka do paczkomatu INPOST za pobraniem - 20 zł</span></strong></p>\n<p style=\"margin-left:40px;text-align:left;\"><span style=\"font-size:14px;\"><strong>c) przesyłka kurierska</strong> za pobraniem<strong> - </strong><span style=\"background-color:#ffffff;\"><strong>23 zł</strong></span></span></p>\n<p style=\"text-align:left;\"><span style=\"font-size:14px;\"><strong>4.<span style=\"color:#000000;\"><span style=\"font-size:14px;\"><strong> </strong></span></span></strong></span>Darmowa dostawa <span style=\"font-size:14px;\"><strong>od 250 zł</strong></span></p>\n<p style=\"text-align:left;\"><span style=\"color:#000000;\"><span style=\"font-size:14px;\">Przy zamówieniu towaru opłaconego z góry za kwotę powyżej </span></span><span style=\"font-size:14px;\"><strong>250 zł</strong> </span><span style=\"color:#000000;\"><span style=\"font-size:14px;\">(bez uwzględnienia kosztów dostawy) </span></span><span style=\"font-size:14px;\">– <strong>dostawa na terenie Polski</strong></span><span style=\"color:#000000;\"><span style=\"font-size:14px;\">  - </span></span><span style=\"font-size:14px;\"><strong> GRATIS.</strong></span></p>\n<p style=\"text-align:left;\"><span style=\"font-size:14px;\"><strong>5. Odbiór osobisty w Olsztynie – 0,00 zł</strong></span></p>\n<p><span style=\"font-size:14px;\">Odbiór możliwy jest w Olsztynie na Dajtkach. Ponieważ nie prowadzimy stałego punktu sprzedaży stacjonarnej, konieczne jest umówienie odbioru za pomocą maila: <a href=\"mailto:kontakt@wloczkiwarmii.pl\">kontakt@wloczkiwarmii.pl </a>lub telefonicznie: 602 – 735 – 745. Nie ma jednak możliwości zapłaty przy odbiorze. Płatność musi być dokonana z góry na konto bankowe. Wynika to z tego, że prowadząc sprzedaż internetową, wszystkie operacje muszą być zaksięgowane na naszym koncie firmowym. </span></p>\n<p><span style=\"font-size:14px;\">Istnieje możliwość dostarczenia towaru do domu Klienta na terenie Olsztyna.</span></p>\n<p style=\"text-align:left;\"><span style=\"font-size:14px;\"><strong>6. Przesyłki zagraniczne – </strong>przesyłka kurierska - 65,00 zł. W przypadku dużych zamówień w celu wyceny kosztów przesyłki prosimy o kontakt mailowy: <a href=\"mailto:kontakt@wloczkiwarmii.pl\">kontakt@wloczkiwarmii.pl</a></span></p>','wysylka'),(1,2,1,'Delivery','','Our terms and conditions of delivery','conditions, delivery, delay, shipment, pack','<h2>Shipments and returns</h2>\n<h3>Your pack shipment</h3>\n<p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS Extra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p>\n<p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.</p>','delivery'),(2,1,1,'Regulamin','','Legal notice','notice, legal, credits','<p>Zawarcie umowy pomiędzy <strong>Kupującym</strong> a <strong>Sprzedającym</strong> może nastąpić na dwa sposoby.</p>\n<p><strong>Kupujący</strong> ma prawo przed złożeniem zamówienia do negocjacji wszelkich zapisów umowy ze <strong>Sprzedającym</strong>, w tym również zmieniających zapisy poniższego regulaminu. Negocjacje, te powinny być prowadzone w formie pisemnej i kierowane na adres <strong>Sprzedającego</strong> (<strong>WŁÓCZKI WARMII</strong><strong> </strong><strong>Joanna Skiba-Michalewska, ul. B. Laszki 7/38, 10-687 Olsztyn</strong>).</p>\n<p>W przypadku zrezygnowania przez <strong>Kupującego</strong> z możliwości zawarcia umowy na drodze indywidualnych negocjacji zastosowanie ma poniższy regulamin i stosowne przepisy prawa.</p>\n<p> </p>\n<p style=\"text-align:center;\"><strong>REGULAMIN</strong></p>\n<p style=\"text-align:center;\"><strong>§</strong><strong>1 </strong><strong>Definicje</strong></p>\n<ol>\n<li>\n<p><strong>Adres pocztowy</strong> - imię i nazwisko lub nazwa instytucji, położenie w miejscowości (w przypadku miejscowości podzielonej na ulice: ulica, numer budynku, numer mieszkania lub lokalu; w przypadku miejscowości niepodzielonej na ulice: nazwa miejscowości i numer nieruchomości), kod pocztowy oraz miejscowość.</p>\n</li>\n<li>\n<p><strong>Adres reklamacyjny:</strong></p>\n</li>\n</ol>\n<p style=\"text-align:center;\"><strong>WŁÓCZKI WARMII</strong><strong> </strong><strong>Joanna Skiba-Michalewska</strong><br /><strong>ul. B. Laszki 7/38</strong><br /><strong>10-687 Olsztyn</strong></p>\n<ol start=\"3\">\n<li>\n<p><strong>Cennik dostaw </strong>– znajdujące się pod adresem <a href=\"http://wloczkiwarmii.pl/wysylka\"><strong>wloczkiwarmii.pl/wysylka</strong></a> zestawienie dostępnych rodzajów dostawy i ich kosztów.</p>\n</li>\n<li>\n<p><strong>Dane kontaktowe:</strong></p>\n</li>\n</ol>\n<p style=\"text-align:center;\"><strong>WŁÓCZKI WARMII<strong> </strong>Joanna Skiba-Michalewska</strong><br /><strong>ul. B. Laszki 7/38</strong><br /><strong>10-687 Olsztyn</strong><br /><strong>e-mail: kontakt@wloczkiwarmii.pl<br />telefon: 602-735-745</strong></p>\n<ol start=\"5\">\n<li>\n<p><strong>Dostawa –</strong> rodzaj usługi przewozowej wraz z określeniem przewoźnika i kosztu wymieniona w <strong>cenniku dostaw</strong> znajdującym pod adresem <strong> </strong><a href=\"http://wloczkiwarmii.pl/wysylka\"><strong>wloczkiwarmii.pl/wysylka</strong></a></p>\n</li>\n<li>\n<p><strong>Dowód zakupu –</strong> faktura, rachunek lub paragon wystawione zgodnie z Ustawą o podatku od towarów i usług z dnia 11 marca 2004 roku z późniejszymi zmianami i innymi stosownymi przepisami prawa.</p>\n</li>\n<li>\n<p><strong>Karta produktu</strong> – pojedyncza podstrona <strong>sklepu</strong> zawierająca informacje o pojedynczym <strong>produkcie</strong>.</p>\n</li>\n<li>\n<p><strong>Klient </strong>– pełnoletnia osoba fizyczna posiadająca pełną zdolność do czynności prawnych, osoba prawna lub jednostka organizacyjna nie posiadająca osobowości prawnej a posiadająca zdolność do czynności prawnych, dokonująca u <strong>Sprzedającego</strong> zakupu związanego bezpośrednio z jej działalnością gospodarczą lub zawodową.</p>\n</li>\n<li>\n<p><strong>Kodeks cywilny</strong> – ustawa kodeks cywilny z dnia 23 kwietnia 1964 roku z późniejszymi zmianami.</p>\n</li>\n<li>\n<p><strong>Kodeks dobrych praktyk</strong> – zbiór zasad postępowania, a w szczególności norm etycznych i zawodowych, o których mowa w art 2 pkt. 5 Ustawy o przeciwdziałaniu nieuczciwym praktykom rynkowym z dnia 23 sierpnia 2007 roku z późniejszymi zmianami.</p>\n</li>\n<li>\n<p><strong>Konsument</strong> – pełnoletnia osoba fizyczna posiadająca pełną zdolność do czynności prawnych, dokonująca u <strong>Sprzedającego</strong> zakupu niezwiązanego bezpośrednio z jej działalnością gospodarczą lub zawodową.</p>\n</li>\n<li>\n<p><strong>Koszyk </strong>– lista produktów sporządzona z oferowanych w <strong>sklepie</strong> <strong>produktów </strong>na podstawie wyborów <strong>Kupującego</strong>.</p>\n</li>\n<li>\n<p><strong>Kupujący</strong> – zarówno <strong>Konsument</strong>, jak i <strong>Klient</strong>.</p>\n</li>\n<li>\n<p><strong>Miejsce wydania rzeczy</strong> – <strong>adres pocztowy</strong> lub <strong>punkt odbioru</strong> wskazane w <strong>zamówieniu </strong>przez <strong>Kupującego</strong>.</p>\n</li>\n<li>\n<p><strong>Moment wydania rzeczy </strong>– moment, w którym <strong>Kupujący</strong> lub wskazana przez niego do odbioru osoba trzecia obejmie rzecz w posiadanie.</p>\n</li>\n<li>\n<p><strong>Płatność</strong> – metoda dokonania zapłaty za <strong>przedmiot umowy</strong> i <strong>dostawę</strong> wymieniona pod adresem <a href=\"http://wloczkiwarmii.pl/platnosci\"><strong> </strong><strong>wloczkiwarmii.pl/platnosci</strong></a></p>\n</li>\n<li>\n<p><strong>Prawo konsumenckie </strong>– ustawa o prawach konsumenta z dnia 30 maja 2014 roku.</p>\n</li>\n<li>\n<p><strong>Produkt –</strong> minimalna i niepodzielna ilość <strong>rzeczy</strong>, która może być przedmiotem <strong>zamówienia</strong>, a która podana jest w <strong>sklepie Sprzedającego</strong> jako jednostka miary przy określeniu jego ceny (cena/jednostka).</p>\n</li>\n<li>\n<p><strong>Przedmiot umowy </strong>– produkty i dostawa będące przedmiotem <strong>umowy.</strong></p>\n</li>\n<li>\n<p><strong>Przedmiot świadczenia</strong> – <strong>przedmiot umowy.</strong></p>\n</li>\n<li>\n<p><strong>Punkt odbioru</strong> – miejsce wydania rzeczy nie będące adresem pocztowym, wymienione w zestawieniu udostępnionym przez <strong>Sprzedającego</strong> w <strong>sklepie</strong>.</p>\n</li>\n<li>\n<p><strong>Rzecz –</strong> rzecz ruchoma mogąca być lub będąca przedmiotem <strong>umowy</strong>.</p>\n</li>\n<li>\n<p><strong>Sklep </strong>– serwis internetowy dostępny pod adresem <strong>wloczkiwarmii.pl</strong>, za pośrednictwem którego <strong>Kupujący</strong> może złożyć <strong>zamówienie</strong>.</p>\n</li>\n<li>\n<p><strong>Sprzedający: </strong></p>\n</li>\n</ol>\n<p style=\"text-align:center;\"><strong>WŁÓCZKI WARMII<strong> </strong>Joanna Skiba-Michalewska</strong><br /><strong>ul. B. Laszki 7/38</strong><br /><strong>10-687 Olsztyn</strong></p>\n<p style=\"text-align:center;\"><strong>NIP: 7393447195, REGON: 280112621 </strong></p>\n<p style=\"text-align:center;\">zarejestrowany i widoczny w ewidencji CEDIG pod adresem:<br /><a href=\"https://prod.ceidg.gov.pl/CEIDG/CEIDG.Public.UI/Search.aspx\">https://prod.ceidg.gov.pl/CEIDG/CEIDG.Public.UI/Search.aspx</a></p>\n<p style=\"text-align:center;\">KONTO BANKOWE:<strong> 96 </strong><strong>1140 2004 0000 3702 4219 7592</strong></p>\n<ol start=\"25\">\n<li>\n<p><strong>System</strong> – zespół współpracujących ze sobą urządzeń informatycznych i oprogramowania, zapewniający przetwarzanie i przechowywanie, a także wysyłanie i odbieranie danych poprzez sieci telekomunikacyjne za pomocą właściwego dla danego rodzaju sieci urządzenia końcowego, potocznie określany Internetem.</p>\n</li>\n<li>\n<p><strong>Termin realizacji</strong> – podana na <strong>karcie produktu</strong> liczba godzin lub dni roboczych.</p>\n</li>\n<li>\n<p><strong>Umowa </strong>– umowa zawierana poza lokalem przedsiębiorcy lub na odległość w rozumieniu Ustawy o prawach konsumenta z dnia 30 maja 2014 roku w przypadku <strong>Konsumentów</strong> i umowa sprzedaży w rozumieniu art. 535 Ustawy kodeks cywilny z dnia 23 kwietnia 1964 roku w przypadku <strong>Kupujących</strong>.</p>\n</li>\n<li>\n<p><strong>Wada </strong>– zarówno <strong>wada fizyczna</strong>, jak i <strong>wada prawna.</strong></p>\n</li>\n<li>\n<p><strong>Wada fizyczna</strong> – niezgodność rzeczy sprzedanej z umową, a w szczególności jeśli rzecz:</p>\n<ol>\n<li>\n<p>nie ma ona właściwości, które rzecz tego rodzaju powinna mieć ze względu na cel w umowie oznaczony albo wynikający z okoliczności lub przeznaczenia;</p>\n</li>\n<li>\n<p>nie ma właściwości, o których istnieniu <strong>Sprzedający</strong> zapewnił <strong>Konsumenta</strong>,</p>\n</li>\n<li>\n<p>nie nadaje się do celu, o którym <strong>Konsument</strong> poinformował <strong>Sprzedającego</strong> przy zawarciu umowy, a <strong>Sprzedający</strong> nie zgłosił zastrzeżenia co do takiego jej przeznaczenia;</p>\n</li>\n<li>\n<p>została <strong>Konsumentowi</strong><strong> </strong>wydana w stanie niezupełnym;</p>\n</li>\n<li>\n<p>w razie nieprawidłowego jej zamontowania i uruchomienia, jeżeli czynności te zostały wykonane przez <strong>Sprzedającego</strong> lub osobę trzecią, za którą <strong>Sprzedający</strong> ponosi odpowiedzialność, albo przez <strong>Konsumenta</strong>, który postąpił według instrukcji otrzymanej od <strong>Sprzedającego</strong>;</p>\n</li>\n<li>\n<p>nie ma ona właściwości, o której zapewniał producent lub jego przedstawiciel lub osoba, która wprowadza rzecz do obrotu w zakresie swojej działalności gospodarczej oraz osoba, która przez umieszczenie na rzeczy sprzedanej swojej nazwy, znaku towarowego lub innego oznaczenia odróżniającego przedstawia się jako producent, chyba że <strong>Sprzedający </strong>zapewnień tych nie znał ani, oceniając rozsądnie, nie mógł znać albo nie mogły one mieć wpływu na decyzję <strong>Konsumenta</strong> o zawarciu <strong>umowy</strong>, albo gdy ich treść została sprostowana przed zawarciem <strong>umowy.</strong></p>\n</li>\n</ol>\n</li>\n<li>\n<p><strong>Wada prawna</strong> – sytuacja, kiedy rzecz sprzedana stanowi własność osoby trzeciej albo jest obciążona prawem osoby trzeciej, a także jeżeli ograniczenie w korzystaniu lub rozporządzaniu rzeczą wynika z decyzji lub orzeczenia właściwego organu.</p>\n</li>\n<li>\n<p><strong>Zamówienie</strong> – oświadczenie woli <strong>Kupującego </strong>złożone za pośrednictwem <strong>sklepu </strong>określające jednoznacznie: rodzaj i ilość <strong>produktów</strong>; rodzaj <strong>dostawy</strong>; rodzaj<strong> płatności</strong>; <strong>miejsce wydania rzeczy</strong>, dane <strong>Kupującego</strong> a zmierzające bezpośrednio do zawarcia <strong>umowy </strong>pomiędzy <strong>Kupującym</strong> a <strong>Sprzedającym</strong>.</p>\n</li>\n</ol>\n<p style=\"text-align:center;\"> </p>\n<p style=\"text-align:center;\"><strong>§2 Warunki ogólne</strong></p>\n<ol>\n<li>\n<p><strong>Umowa</strong> zawierana jest w języku polskim, zgodnie z polskim prawem i niniejszym regulaminem.</p>\n</li>\n<li>\n<p><strong>Miejsce wydania rzeczy </strong>musi znajdować się na terytorium <strong>Rzeczpospolitej Polskiej</strong>.</p>\n</li>\n<li>\n<p><strong>Sprzedający </strong>jest zobowiązany i zobowiązuje się świadczyć usługi i dostarczać rzeczy wolne od <strong>wad</strong>.</p>\n</li>\n<li>\n<p>Wszystkie ceny podawane przez <strong>Sprzedającego</strong> wyrażone są w polskiej walucie i są cenami brutto (zawierają podatek VAT). Ceny <strong>produktów </strong>nie zawierają kosztu <strong>dostawy</strong>, który określony jest w <strong>cenniku dostaw</strong>.</p>\n</li>\n<li>\n<p><strong>Sprzedający</strong> nie udziela <strong>Kupującemu</strong> gwarancji w rozumieniu art. 577 <strong>Kodeksu cywilnego</strong>, natomiast informuje o znanych mu gwarancjach udzielonych przez osoby trzecie dla <strong>produktów </strong>znajdujących się w <strong>sklepie</strong>.</p>\n</li>\n<li>\n<p>Potwierdzenie, udostępnienie, utrwalenie, zabezpieczenie wszelkich istotnych postanowień <strong>umowy</strong> w celu uzyskania dostępu do tych informacji w przyszłości następuje w postaci:</p>\n<ol>\n<li>\n<p>potwierdzenia <strong>zamówienia</strong> poprzez wysłanie na wskazany adres e-mail: zamówienia, faktury pro forma, informacji o prawie odstąpienia od umowy, niniejszego regulaminu w wersji pdf, wzoru formularza odstąpienia od umowy w wersji pdf, linków do samodzielnego pobrania regulaminu i wzorca odstąpienia od umowy;</p>\n</li>\n<li>\n<p>dołączenia do zrealizowanego <strong>zamówienia</strong>, wysłanego do wskazanego <strong>miejsca wydania rzeczy </strong>wydrukowanych: <strong>dowodu zakupu</strong>, informacji o prawie odstąpienia od umowy, niniejszego regulaminu, wzoru formularza odstąpienia od umowy.</p>\n</li>\n</ol>\n</li>\n<li>\n<p><strong>Sprzedający</strong> nie pobiera żadnych opłat za komunikację z nim z wykorzystaniem środków porozumiewania na odległość, a <strong>Kupujący</strong> poniesie jej koszty w wysokości wynikającej z umowy jaką zawarł z osobą trzecią świadczącą na jego rzecz określoną usługę umożliwiającą porozumiewanie na odległość.</p>\n</li>\n<li>\n<p><strong>Sprzedający</strong> zapewnia <strong>Kupującemu</strong> korzystającemu z <strong>systemu</strong> poprawność działania <strong>sklepu</strong> w następujących przeglądarkach: IE wersja 7 lub nowsza, FireFox wersja 3 lub nowsza, Opera wersja 9 lub nowsza, Chrome wersja 10 lub nowsza, Safari z zainstalowanymi najnowszymi wersjami JAVA i FLASH, na ekranach o rozdzielczości poziomej powyżej 1024 px. Używanie oprogramowania firm trzecich mających wpływ na funkcjonowanie i funkcjonalność przeglądarek: Internet Explorer, FireFox, Opera, Chrome, Safari może mieć wpływ na poprawne wyświetlanie sklepu, dlatego w celu uzyskania pełnej funkcjonalności sklepu<strong> www.wloczkiwarmii.pl</strong> należy je wszystkie wyłączyć.</p>\n</li>\n<li>\n<p><strong>Kupujący</strong> może skorzystać z opcji zapamiętania jego danych przez <strong>sklep</strong> w celu ułatwienia procesu składania kolejnego <strong>zamówienia</strong>. W tym celu <strong>Kupujący</strong> powinien podać login i hasło, niezbędne do uzyskania dostępu do swojego konta. Login i hasło są ciągiem znaków ustalanych przez <strong>Kupującego</strong>, który ma obowiązek zachowania ich w tajemnicy i chronienia przed niepowołanym dostępem osób trzecich. <strong>Kupujący </strong>ma w każdej chwili możliwość wglądu, poprawiania, aktualizacji danych oraz usuwania konta w <strong>sklepie</strong>.</p>\n</li>\n<li>\n<p><strong>Sprzedający </strong>stosuje się do <strong>kodeksu dobrych praktyk</strong>.</p>\n</li>\n</ol>\n<p style=\"text-align:center;\"> </p>\n<p style=\"text-align:center;\"><strong>§3 </strong><strong><strong>Zawarcie umowy i realizacja</strong></strong></p>\n<ol>\n<li>\n<p><strong>Zamówienia</strong> można składać 24 godziny na dobę.</p>\n</li>\n<li>\n<p>W celu złożenia <strong>zamówienia</strong> <strong>Kupujący</strong> powinien wykonać co najmniej następujące czynności, z których część może być wielokrotnie powtarzana:</p>\n<ol>\n<li>\n<p>dodanie do <strong>koszyka produktu</strong>;</p>\n</li>\n<li>\n<p>wybór rodzaju <strong>dostawy</strong>;</p>\n</li>\n<li>\n<p>wybór rodzaju <strong>płatności</strong>;</p>\n</li>\n<li>\n<p>wybór <strong>miejsca wydania rzeczy</strong>;</p>\n</li>\n<li>\n<p>złożenie w <strong>sklepie</strong> <strong>zamówienia</strong> poprzez użycie przycisku „<strong>Zamawiam z obowiązkiem zapłaty</strong>”.</p>\n</li>\n</ol>\n</li>\n<li>\n<p>Zawarcie <strong>umowy</strong> z <strong>Konsumentem </strong>następuje z chwilą złożenia <strong>zamówienia</strong>.</p>\n</li>\n<li>\n<p>Realizacja <strong>zamówienia</strong> <strong>Konsumenta </strong>płatnego za pobraniem następuje niezwłocznie, a <strong>zamówienia</strong> płatnego przelewem lub za pośrednictwem systemu płatności elektronicznych po zaksięgowaniu wpłaty <strong>Konsumenta </strong>na koncie <strong>Sprzedającego</strong>.</p>\n</li>\n<li>\n<p>Zawarcie <strong>umowy</strong> z <strong>Klientem </strong>następuje z chwilą przyjęcia <strong>zamówienia</strong> przez <strong>Sprzedającego</strong>, o czym informuje on <strong>Klienta</strong> w terminie do 48 godzin od złożenia <strong>zamówienia</strong>.</p>\n</li>\n<li>\n<p>Realizacja <strong>zamówienia</strong> <strong>Klienta </strong>płatnego za pobraniem następuje niezwłocznie po zawarciu <strong>umowy</strong>, a <strong>zamówienia</strong> płatnego przelewem lub za pośrednictwem systemu płatności elektronicznych po zawarciu <strong>umowy</strong> i zaksięgowaniu wpłaty <strong>Klienta </strong>na koncie <strong>Sprzedającego</strong>.</p>\n</li>\n<li>\n<p>Realizacja <strong>zamówienia</strong> <strong>Klienta</strong> może być uzależniona od dokonania wpłaty całości lub części wartości <strong>zamówienia</strong> lub uzyskania limitu kredytu kupieckiego co najmniej o wartości <strong>zamówienia</strong> lub zgody <strong>Sprzedającego</strong> na wysłanie <strong>zamówienia</strong> za pobraniem (płatnego przy odbiorze).</p>\n</li>\n<li>\n<p>Wysłanie <strong>przedmiotu umowy</strong> następuje w terminie określonym na <strong>karcie</strong> <strong>produktu</strong>, a dla <strong>zamówień</strong> złożonych z wielu <strong>produktów</strong> w najdłuższym terminie z określonych na <strong>kartach</strong> <strong>produktów</strong>. Bieg terminu rozpoczyna się z chwilą realizacji <strong>zamówienia</strong>.</p>\n</li>\n<li>\n<p>Zakupiony <strong>przedmiot umowy</strong> jest wraz z wybranym przez <strong>Kupującego dokumentem sprzedaży</strong> wysyłany wybranym przez <strong>Kupującego </strong>rodzajem <strong>dostawy</strong> do wskazanego przez <strong>Kupującego </strong>w <strong>zamówieniu miejsca wydania rzeczy</strong>, wraz z dołączonymi załącznikami, o których mowa w <strong>§2 pkt 6b.</strong></p>\n</li>\n</ol>\n<p style=\"text-align:center;\"> </p>\n<p style=\"text-align:center;\"><strong>§4 </strong><strong><strong>Prawo do odstąpienia od umowy</strong></strong></p>\n<ol>\n<li>\n<p><strong>Konsumentowi</strong>, przysługuje na podstawie art. 27 <strong>Prawa konsumenckiego</strong> prawo do odstąpienia od umowy zawartej na odległość, bez podania przyczyny i bez ponoszenia kosztów, z wyjątkiem kosztów określonych w art. 33, art. 34 <strong>Prawa konsumenckiego</strong>.</p>\n</li>\n<li>\n<p>Termin odstąpienia od umowy zawartej na odległość wynosi 14 dni od <strong>momentu wydania rzeczy</strong>, a do zachowania terminu wystarczy wysłanie oświadczenia przed jego upływem.</p>\n</li>\n<li>\n<p>Oświadczenie o odstąpieniu od umowy <strong>Konsument</strong> może złożyć na formularzu, którego wzór stanowi załącznik nr 2 do <strong>Prawa konsumenckiego</strong>, na formularzu dostępnym pod adresem <a href=\"http://wloczkiwarmii.pl/forms/formularz-odstapienie-oraz-informacja.pdf\"><strong>wloczkiwarmii.pl/forms/formularz-odstapienie-oraz-informacja.pdf</strong></a> lub w innej pisemnej formie zgodnej z <strong>Prawem konsumenckim</strong>.</p>\n</li>\n<li>\n<p><strong>Sprzedający</strong> wyłącza możliwość złożenia oświadczenia o odstąpieniu od umowy w innej niż pisemna formie.</p>\n</li>\n<li>\n<p><strong>Sprzedający</strong> niezwłocznie potwierdzi <strong>Konsumentowi </strong>na e-mail (podany przy zawieraniu <strong>umowy</strong> i inny jeżeli został podany w złożonym oświadczeniu) otrzymanie oświadczenia o odstąpieniu od umowy.</p>\n</li>\n<li>\n<p>W przypadku odstąpienia od umowy, <strong>umowa </strong>jest uważana za niezawartą.</p>\n</li>\n<li>\n<p><strong>Konsument</strong> ma obowiązek zwrócić rzecz <strong>Sprzedającemu</strong> niezwłocznie, jednak nie później niż 14 dni od dnia, w którym odstąpił od umowy. Do zachowania terminu wystarczy odesłanie rzeczy przed jego upływem.</p>\n</li>\n<li>\n<p><strong>Konsument</strong> odsyła rzeczy będące przedmiotem umowy, od której odstąpił na własny koszt i ryzyko.</p>\n</li>\n<li>\n<p><strong>Konsument </strong>nie ponosi kosztów dostarczania treści cyfrowych, które nie są zapisane na nośniku materialnym, jeżeli nie wyraził zgody na spełnienie świadczenia przed upływem terminu do odstąpienia od umowy lub nie został poinformowany o utracie przysługującego mu prawa odstąpienia od umowy w chwili udzielania takiej zgody lub przedsiębiorca nie dostarczył potwierdzenia zgodnie z art. 15 ust. 1 i art. 21 ust. 1. <strong>Prawa konsumenckiego</strong>.</p>\n</li>\n<li>\n<p><strong>Konsument</strong> ponosi odpowiedzialność za zmniejszenie wartości rzeczy będącej przedmiotem umowy a będące wynikiem korzystania z niej w sposób wykraczający poza konieczny do stwierdzenia charakteru, cech i funkcjonowania rzeczy.</p>\n</li>\n<li>\n<p><strong>Sprzedający</strong> niezwłocznie, nie później niż w terminie 14 dni od dnia otrzymania oświadczenia o odstąpieniu od umowy złożonego przez <strong>Konsumenta </strong>zwróci <strong>Konsumentowi</strong> wszystkie dokonane przez niego płatności, w tym koszty dostarczenia rzeczy, a jeżeli <strong>Konsument</strong> wybrał sposób dostawy inny niż najtańszy zwykły sposób dostarczenia oferowany przez <strong>Sprzedającego</strong>,<strong> Sprzedający</strong> nie zwróci <strong>Konsumentowi</strong> dodatkowych kosztów zgodnie z art 33 <strong>Prawa konsumenckiego</strong>.</p>\n</li>\n<li>\n<p><strong>Sprzedający </strong>dokonuje zwrotu zapłaty przy użyciu takiego samego sposobu <strong>płatności</strong>, jakiego użył <strong>Konsument</strong>, chyba że <strong>Konsument</strong> wyraźnie zgodził się na inny sposób <strong>płatności</strong>, który nie wiąże się dla niego z żadnymi kosztami.</p>\n</li>\n<li>\n<p><strong>Sprzedający</strong> może wstrzymać się ze zwrotem zapłaty otrzymanej od <strong>Konsumenta</strong> do chwili otrzymania rzeczy z powrotem lub dostarczenia przez <strong>Konsumenta</strong> dowodu jej odesłania, w zależności od tego, które zdarzenie nastąpi wcześniej.</p>\n</li>\n<li>\n<p><strong>Konsumentowi </strong>zgodnie z art 38 <strong>Prawa konsumenckiego </strong>nie przysługuje prawo do odstąpienia od umowy:</p>\n<ol>\n<li>\n<p>w której cena lub wynagrodzenie zależy od wahań na rynku finansowym, nad którymi <strong>Sprzedający</strong> nie sprawuje kontroli, i które mogą wystąpić przed upływem terminu do odstąpienia od umowy;</p>\n</li>\n<li>\n<p>w której <strong>przedmiotem świadczenia</strong> jest rzecz nieprefabrykowana, wyprodukowana według specyfikacji konsumenta lub służąca zaspokojeniu jego zindywidualizowanych potrzeb;</p>\n</li>\n<li>\n<p>w której <strong>przedmiotem świadczenia</strong> jest rzecz ulegająca szybkiemu zepsuciu lub mająca krótki termin przydatności do użycia;</p>\n</li>\n<li>\n<p>w której <strong>przedmiotem świadczenia</strong> jest rzecz dostarczana w zapieczętowanym opakowaniu, której po otwarciu opakowania nie można zwrócić ze względu na ochronę zdrowia lub ze względów higienicznych, jeżeli opakowanie zostało otwarte po dostarczeniu;</p>\n</li>\n<li>\n<p>w której <strong>przedmiotem świadczenia</strong> są rzeczy, które po dostarczeniu, ze względu na swój charakter, zostają nierozłącznie połączone z innymi rzeczami;</p>\n</li>\n<li>\n<p>w której <strong>przedmiotem świadczenia</strong> są nagrania dźwiękowe lub wizualne albo programy komputerowe dostarczane w zapieczętowanym opakowaniu, jeżeli opakowanie zostało otwarte po dostarczeniu;</p>\n</li>\n<li>\n<p>o dostarczanie treści cyfrowych, które nie są zapisane na nośniku materialnym, jeżeli spełnianie świadczenia rozpoczęło się za wyraźną zgodą <strong>Konsumenta</strong> przed upływem terminu do odstąpienia od umowy i po poinformowaniu go przez przedsiębiorcę o utracie prawa odstąpienia od umowy;</p>\n</li>\n<li>\n<p>o dostarczanie dzienników, periodyków lub czasopism, z wyjątkiem umowy o prenumeratę.</p>\n</li>\n</ol>\n</li>\n</ol>\n<p> </p>\n<p style=\"text-align:center;\"><strong>§5 </strong><strong><strong>Rękojmia</strong></strong></p>\n<ol>\n<li>\n<p><strong>Sprzedający </strong>na podstawie art. 558§1 <strong>Kodeksu cywilnego </strong>całkowicie wyłącza odpowiedzialność wobec <strong>Klientów </strong>z tytułu wad fizycznych i prawnych (rękojmia).</p>\n</li>\n<li>\n<p><strong>Sprzedający</strong> ponosi odpowiedzialność wobec <strong>Konsumenta</strong> na zasadach określonych w art. 556 <strong>Kodeksu cywilnego </strong>i kolejnych za<strong> wady</strong> (rękojmia).</p>\n</li>\n<li>\n<p>W przypadku umowy z<strong> Konsumentem</strong> jeżeli <strong>wada fizyczna</strong> została stwierdzona przed upływem roku od <strong>momentu wydania rzeczy</strong>, przyjmuje się, że istniała ona w chwili przejścia niebezpieczeństwa na <strong>Konsumenta</strong>.</p>\n</li>\n<li>\n<p><strong>Konsument </strong>jeżeli rzecz sprzedana ma <strong>wadę</strong>, może:</p>\n<ol>\n<li>\n<p>złożyć oświadczenie o żądaniu obniżenia ceny;</p>\n</li>\n<li>\n<p>złożyć oświadczenie o odstąpieniu od umowy;</p>\n</li>\n</ol>\n</li>\n</ol>\n<p style=\"margin-left:0.51in;\">chyba że <strong>Sprzedający</strong> niezwłocznie i bez nadmiernych niedogodności dla <strong>Konsumenta</strong> wymieni rzecz wadliwą na wolną od wad albo wadę usunie. Jeżeli jednak rzecz była już wymieniona lub naprawiana przez <strong>Sprzedającego</strong> albo <strong>Sprzedający</strong> nie uczynił zadość obowiązkowi wymiany rzeczy na wolną od wad lub usunięcia wady, nie przysługuje mu prawo do wymiany rzeczy lub usunięcia wady.</p>\n<ol start=\"5\">\n<li>\n<p><strong>K</strong><strong>onsument</strong>, może zamiast zaproponowanego przez <strong>Sprzedającego </strong>usunięcia wady żądać wymiany rzeczy na wolną od wad albo zamiast wymiany rzeczy żądać usunięcia wady, chyba że doprowadzenie rzeczy do zgodności z umową w sposób wybrany przez <strong>Konsumenta</strong> jest niemożliwe albo wymagałoby nadmiernych kosztów w porównaniu ze sposobem proponowanym przez <strong>Sprzedającego</strong>, przy czym przy ocenie nadmierności kosztów uwzględnia się wartość rzeczy wolnej od wad, rodzaj i znaczenie stwierdzonej wady, a także bierze się pod uwagę niedogodności, na jakie narażałby <strong>Konsumenta</strong> inny sposób zaspokojenia.</p>\n</li>\n<li>\n<p><strong>Konsument</strong> nie może odstąpić od <strong>umowy</strong>, jeżeli <strong>wada</strong> jest nieistotna.</p>\n</li>\n<li>\n<p><strong>Konsument </strong>jeżeli rzecz sprzedana ma wadę, może również:</p>\n<ol>\n<li>\n<p>żądać wymiany rzeczy na wolną od wad;</p>\n</li>\n<li>\n<p>żądać usunięcia wady.</p>\n</li>\n</ol>\n</li>\n<li>\n<p><strong>Sprzedający</strong> jest obowiązany wymienić rzecz wadliwą na wolną od wad lub usunąć wadę w rozsądnym czasie bez nadmiernych niedogodności dla <strong>Konsumenta. </strong></p>\n</li>\n<li>\n<p><strong>Sprzedający</strong> może odmówić zadośćuczynienia żądaniu <strong>Konsumenta</strong>, jeżeli doprowadzenie do zgodności z umową rzeczy wadliwej w sposób wybrany przez kupującego jest niemożliwe albo w porównaniu z drugim możliwym sposobem doprowadzenia do zgodności z umową wymagałoby nadmiernych kosztów.</p>\n</li>\n<li>\n<p>W przypadku, jeżeli rzecz wadliwa została zamontowana, <strong>Konsument</strong> może żądać od <strong>Sprzedającego</strong> demontażu i ponownego zamontowania po dokonaniu wymiany na wolną od wad lub usunięciu wady, jednak zobowiązany jest ponieść część związanych z tym kosztów przewyższających cenę rzeczy sprzedanej albo może żądać od <strong>Sprzedającego</strong> zapłaty części kosztów demontażu i ponownego zamontowania, do wysokości ceny rzeczy sprzedanej. W razie niewykonania obowiązku przez <strong>Sprzedającego</strong>,<strong> Konsument</strong> jest upoważniony do dokonania tych czynności na koszt i niebezpieczeństwo <strong>Sprzedającego</strong>.</p>\n</li>\n<li>\n<p><strong>Konsument</strong>, który wykonuje uprawnienia z tytułu rękojmi, jest obowiązany na koszt <strong>Sprzedającego </strong>dostarczyć rzecz wadliwą na <strong>a</strong><strong>dres reklamacyjny, </strong>a jeżeli ze względu na rodzaj rzeczy lub sposób jej zamontowania dostarczenie rzeczy przez <strong>Konsumenta</strong> byłoby nadmiernie utrudnione, <strong>Konsument</strong> obowiązany jest udostępnić rzecz <strong>Sprzedającemu</strong> w miejscu, w którym rzecz się znajduje. W razie niewykonania obowiązku przez <strong>Sprzedającego Konsument</strong> jest upoważniony do odesłania rzeczy na koszt i niebezpieczeństwo <strong>Sprzedającego</strong>.</p>\n</li>\n<li>\n<p>Koszty wymiany lub naprawy ponosi <strong>Sprzedający</strong>, za wyjątkiem sytuacji opisanej w <strong>§4 </strong>pkt 10.</p>\n</li>\n<li>\n<p><strong>Sprzedający</strong> obowiązany jest przyjąć od <strong>Konsumenta</strong> rzecz wadliwą w razie wymiany rzeczy na wolną od wad lub odstąpienia od umowy.</p>\n</li>\n<li>\n<p><strong>Sprzedający </strong>w terminie czternastu dni ustosunkuje się do:</p>\n<ol>\n<li>\n<p>oświadczenia o żądaniu obniżenia ceny;</p>\n</li>\n<li>\n<p>oświadczenia o odstąpieniu od umowy;</p>\n</li>\n<li>\n<p>żądania wymiany rzeczy na wolną od wad;</p>\n</li>\n<li>\n<p>żądania usunięcia wady.</p>\n</li>\n</ol>\n</li>\n</ol>\n<p>W przeciwnym wypadku uważa się, że uznał za uzasadnione oświadczenie lub żądanie <strong>Konsumenta</strong>.</p>\n<ol start=\"15\">\n<li>\n<p><strong>Sprzedający </strong>odpowiada z tytułu rękojmi, jeżeli wada fizyczna zostanie stwierdzona przed upływem dwóch lat <strong>od momentu wydania</strong> rzeczy <strong>Konsumentowi</strong>, a jeżeli przedmiotem sprzedaży jest rzecz używana przed upływem roku <strong>od momentu wydania</strong> rzeczy <strong>Konsumentowi</strong>.</p>\n</li>\n<li>\n<p>Roszczenie <strong>Konsumenta </strong>o usunięcie wady lub wymianę rzeczy sprzedanej na wolną od wad przedawnia się z upływem roku, licząc od dnia stwierdzenia wady jednak nie wcześniej niż przed upływem dwóch lat <strong>od momentu wydania</strong> rzeczy <strong>Konsumentowi</strong>, a jeżeli przedmiotem sprzedaży jest rzecz używana przed upływem roku <strong>od momentu wydania</strong> rzeczy <strong>Konsumentowi</strong>.</p>\n</li>\n<li>\n<p>W przypadku, kiedy określony przez <strong>Sprzedającego</strong> lub producenta termin przydatności rzeczy do użycia kończy się po upływie dwóch lat od <strong>momentu wydania rzeczy Konsumentowi</strong>, <strong>Sprzedający</strong> odpowiada z tytułu rękojmi za wady fizyczne tej rzeczy stwierdzone przed upływem tego terminu.</p>\n</li>\n<li>\n<p>W terminach określonych w <strong>§4 pkt </strong>15-17 <strong>Konsument</strong> może złożyć oświadczenie o odstąpieniu od umowy albo obniżeniu ceny z powodu wady fizycznej rzeczy sprzedanej, a jeżeli <strong>Konsument</strong> żądał wymiany rzeczy na wolną od wad lub usunięcia wady, bieg terminu do złożenia oświadczenia o odstąpieniu od umowy albo obniżeniu ceny rozpoczyna się z chwilą bezskutecznego upływu terminu do wymiany rzeczy lub usunięcia wady.</p>\n</li>\n<li>\n<p>W razie dochodzenia przed sądem albo sądem polubownym jednego z uprawnień z tytułu rękojmi termin do wykonania innych uprawnień, przysługujących <strong>Konsumentowi</strong> z tego tytułu, ulega zawieszeniu do czasu prawomocnego zakończenia postępowania. Odpowiednio stosuje się również do postępowania mediacyjnego, przy czym termin do wykonania innych uprawnień z tytułu rękojmi, przysługujących <strong>Konsumentowi</strong>, zaczyna biec od dnia odmowy przez sąd zatwierdzenia ugody zawartej przed mediatorem lub bezskutecznego zakończenia mediacji.</p>\n</li>\n<li>\n<p>Do wykonywania uprawnień z tytułu rękojmi za<strong> wady prawne</strong> rzeczy sprzedanej stosuje się <strong>§4 pkt</strong> 15-16, z tym że bieg terminu rozpoczyna się od dnia, w którym <strong>Konsument</strong> dowiedział się o istnieniu wady, a jeżeli <strong>Konsument</strong> dowiedział się o istnieniu wady dopiero na skutek powództwa osoby trzeciej – od dnia, w którym orzeczenie wydane w sporze z osobą trzecią stało się prawomocne.</p>\n</li>\n<li>\n<p>Jeżeli z powodu wady rzeczy <strong>Konsument </strong>złożył oświadczenie o odstąpieniu od umowy albo obniżeniu ceny, może on żądać naprawienia szkody, którą poniósł przez to, że zawarł umowę, nie wiedząc o istnieniu wady, choćby szkoda była następstwem okoliczności, za które <strong>Sprzedający</strong> nie ponosi odpowiedzialności, a w szczególności może żądać zwrotu kosztów zawarcia umowy, kosztów odebrania, przewozu, przechowania i ubezpieczenia rzeczy, zwrotu dokonanych nakładów w takim zakresie, w jakim nie odniósł z nich korzyści, a nie otrzymał ich zwrotu od osoby trzeciej oraz zwrotu kosztów procesu. Nie uchybia to przepisom o obowiązku naprawienia szkody na zasadach ogólnych.</p>\n</li>\n<li>\n<p>Upływ żadnego terminu do stwierdzenia wady nie wyłącza wykonania uprawnień z tytułu rękojmi, jeżeli <strong>Sprzedający </strong>wadę podstępnie zataił.</p>\n</li>\n</ol>\n<p> </p>\n<p style=\"text-align:center;\"><strong>§6 Polityka prywatności oraz bezpieczeństwo danych osobowych</strong></p>\n<ol>\n<li>\n<p>Administratorem baz danych osobowych przekazywanych przez <strong>Konsumentów</strong> <strong>sklepu</strong> jest <strong>Sprzedający</strong>.</p>\n</li>\n<li>\n<p><strong>Sprzedający</strong> zobowiązuje się do ochrony danych osobowych zgodnie z Ustawą o ochronie danych osobowych z dnia 29 sierpnia 1997 roku oraz Ustawą o świadczeniu usług drogą elektroniczną z dnia 18 lipca 2002 roku. <strong>Kupujący </strong>podając przy składaniu zamówienia swoje dane osobowe <strong>Sprzedającemu</strong> wyraża zgodę na ich przetwarzanie przez <strong>Sprzedającego </strong>w celu realizacji złożonego zamówienia. <strong>Kupujący </strong>ma w każdej chwili możliwość wglądu, poprawiania, aktualizacji oraz usuwania swoich danych osobowych.</p>\n</li>\n<li>\n<p>Szczegółowe zasady zbierania, przetwarzania i przechowywania danych osobowych wykorzystywanych w celu realizacji <strong>zamówień</strong> przez <strong>sklep</strong> zostały opisane w Polityce prywatności, która znajduje się pod adresem: <a href=\"http://wloczkiwarmii.pl/polityka-prywatnosci\"><strong>wloczkiwarmii.pl/polityka-prywatnosci</strong></a></p>\n</li>\n</ol>\n<p> </p>\n<p><strong>Postanowienia końcowe</strong></p>\n<ol>\n<li>\n<p>Żadne z postanowień niniejszego regulaminu nie ma na celu naruszenia praw <strong>Kupującego</strong>. Nie może być również w ten sposób interpretowane, gdyż w przypadku niezgodności jakiejkolwiek części regulaminu z obowiązującym prawem <strong>Sprzedający</strong> deklaruje bezwzględne podporządkowanie się i stosowanie tego prawa w miejsce zakwestionowanego przepisu regulaminu.</p>\n</li>\n<li>\n<p>O zmianach regulaminu i ich zakresie zarejestrowani <strong>Kupujący</strong> będą powiadomieni drogą elektroniczną (na wskazany przy rejestracji lub zamówieniu e-mail). Powiadomienie zostanie wysłane co najmniej na 30 dni przed wejściem w życie nowego regulaminu. Zmiany wprowadzane będą w celu dostosowania regulaminu do obowiązującego stanu prawnego.</p>\n</li>\n<li>\n<p>Aktualna wersja regulaminu jest zawsze dostępna dla <strong>Kupującego</strong> w zakładce regulamin (<a href=\"http://wloczkiwarmii.pl/regulamin\"><strong>wloczkiwarmii.pl/regulamin</strong></a>). W trakcie realizacji zamówienia oraz w całym okresie opieki posprzedażowej <strong>Kupującego </strong>obowiązuje regulamin zaakceptowany przez niego przy składaniu zamówienia. Za wyjątkiem sytuacji, kiedy <strong>Konsument </strong>uzna go za mniej korzystny od aktualnego i poinformuje <strong>Sprzedającego </strong>o wyborze aktualnego jako obowiązującego.</p>\n</li>\n<li>\n<p>W sprawach nieuregulowanych niniejszym regulaminem stosuje się odpowiednie obowiązujące przepisy prawne. Kwestie sporne, jeśli <strong>Konsument</strong> wyrazi taką wolę, rozwiązuje się na drodze postępowania mediacyjnego lub sądu polubownego. W ostateczności sprawę rozstrzyga sąd właściwy miejscowo i rzeczowo.</p>\n</li>\n</ol>\n<p> </p>\n<p style=\"text-align:right;\"><em><em>(Olsztyn</em></em><em><em>, </em></em><em><em>25.12.2014</em></em><em><em>)</em></em></p>\n<div class=\"buttons\"></div>','regulamin'),(2,2,1,'Legal Notice','','Legal notice','notice, legal, credits','<h2>Legal</h2>\n<h3>Credits</h3>\n<p>Concept and production:</p>\n<p>This Online store was created using <a href=\"http://www.prestashop.com\">Prestashop Shopping Cart Software</a>,check out PrestaShop\'s <a href=\"http://www.prestashop.com/blog/en/\">ecommerce blog</a> for news and advices about selling online and running your ecommerce website.</p>','legal-notice'),(3,1,1,'Polityka Prywatności','','Our terms and conditions of use','conditions, terms, use, sell','<p><strong>POLITYKA PRYWATNOŚCI</strong></p>\n<p style=\"margin-left:3.75cm;\"><br /> </p>\n<p><strong>Polityka prywatności i wykorzystywania plików </strong></p>\n<p><strong>„cookies” w sklepie internetowym www.wloczkiwarmii.pl</strong></p>\n<p><br /> </p>\n<p>Poniższa <strong>Polityka Prywatności</strong> opisuje zasady przetwarzania i ochrony danych osobowych stosowane w firmie WŁÓCZKI WARMII Joanna Skiba-Michalewska z siedzibą w Olsztynie (10-067) przy ul. Bolesława Laszki 7/38, NIP: 7393447195, REGON: 280112621</p>\n<p> </p>\n<p><strong><em>Podanie danych osobowych, a także zgoda na ich przetwarzanie są całkowicie dobrowolne. Wszelkie przekazane nam dane osobowe są przetwarzane wyłącznie w zakresie i celu, na jaki wyraziłeś zgodę. W przypadku, gdy postanowisz jednak nie podawać nam niezbędnych do realizacji zamówienia danych i nie wyrazisz zgody na ich przetwarzanie, niestety nie będziemy mogli zrealizować Twojego zamówienia.</em></strong></p>\n<p><strong><em>Prosimy, abyś pamiętał, że w każdej chwili masz prawo do aktualizacji lub całkowitego usunięcia swoich danych osobowych. Możesz to zrobić samodzielnie, jak i korzystając z naszej pomocy, której chętnie udzielimy.</em></strong></p>\n<p><strong><em>Zapewniamy Cię, że nasza firma przestrzega restryktywnej polityki bezpieczeństwa danych osobowych. Twoje dane osobowe są u nas bezpieczne i dokładamy wszelkich starań, aby poziom ten z roku na rok był coraz wyższy. Wierzymy, że zapoznanie się z naszą polityką prywatności pozwoli Ci poczuć się bezpiecznie i cieszyć zakupami w sklepie internetowym www.wloczkiwarmii.pl.</em></strong></p>\n<p><br /> </p>\n<p><strong>I. ADMINISTRATOR DANYCH OSOBOWYCH</strong></p>\n<p><br />1.1 Administratorem danych osobowych jest:</p>\n<p>JOANNA SKIBA_MICHALEWSKA, przedsiębiorca prowadzący działalność gospodarczą pod nazwą WŁÓCZKI WARMII Joanna Skiba-Michalewska, wpisany do Centralnej Ewidencji i Informacji o Działalności Gospodarczej prowadzonej przez ministra właściwego do spraw gospodarki i prowadzenia Centralnej Ewidencji i Informacji o Działalności Gospodarczej, NIP 7393447195 , nr REGON 280112621, ul. Bolesława Laszki 7/38, 10-687 Olsztyn.</p>\n<p><br />1.2 Administrator przetwarza dane osobowe zgodnie z wymogami Rozporządzenia Parlamentu Europejskiego i Rady (UE) 2016/679 z dnia 27 kwietnia 2016 r. w sprawie ochrony osób fizycznych w związku z przetwarzaniem danych osobowych i w sprawie swobodnego przepływu takich danych oraz uchylenia dyrektywy 95/46/WE (ogólne rozporządzenie o ochronie danych osobowych) (Dz. Urz. UE L 119, s. 1), zwanej dalej: RODO</p>\n<p> </p>\n<p><strong>II. ZASADY ZBIERANIA DANYCH OSOBOWYCH</strong></p>\n<p><br />2.1 Źródła danych</p>\n<ol>\n<li>\n<p>Podanie danych osobowych jest dobrowolne, ale niezbędne do realizacji zapytań i zamówień. Zgoda wyrażona na każdy cel przetwarzania jest dobrowolna i może być odwołana w dowolnej chwili.</p>\n</li>\n<li>\n<p>Przeglądanie zawartości witryn www nie wymaga ujawniania przez użytkownika danych osobowych. Korzystanie z usług świadczonych przez Administratora może wiązać się z koniecznością podania przez użytkownika danych osobowych. W takim przypadku niepodanie danych osobowych może zmniejszyć możliwości lub ograniczyć całkowicie korzystanie z usługi.</p>\n</li>\n<li>\n<p>W przypadku korzystania przez użytkownika z usług przy użyciu urządzeń przenośnych, Administrator może pozyskać, w szczególności, dane identyfikacyjne urządzenia przenośnego, operatora usług internetowych oraz abonenta. Zebrane w ten sposób dane będą przetwarzane w sposób anonimowy i będą wykorzystywane wyłącznie w celach statystycznych lub w celu zapewnienia prawidłowego korzystania z witryny przez użytkownika.</p>\n</li>\n</ol>\n<p>2. 2 Zakres przechowywanych danych osobowych</p>\n<ol>\n<li>\n<p>Gromadzone dane osobowe mogą obejmować dane niezbędna do:</p>\n<p><strong>REJESTRACJI: </strong></p>\n<p>W trakcie rejestracji prosimy o podanie danych niezbędnych do założenia konta w sklepie internetowym www.wloczkiwarmii.pl<strong>,</strong> dzięki czemu nie musisz przy każdym kolejnym zakupie tracić czasu na ponowne wypełniania całego formularza zamówienia. Rejestrując się oszczędzasz czas i pieniądze, gdyż zarejestrowani klienci uczestniczą w programie lojalnościowym i uzyskują rabaty za wcześniej dokonane zakupy.</p>\n</li>\n</ol>\n<p> </p>\n<p><em>Zarejestrowany klient po zalogowaniu ma również możliwość weryfikacji statusu złożonego zamówienia i historii dokonanych zakupów. Zarejestrowany i zalogowany klient w każdej chwili może samodzielnie poprawiać, uzupełniać dane.</em></p>\n<p> </p>\n<p>W trakcie rejestracji prosimy o:</p>\n<ol>\n<li>\n<p>imię i nazwisko – niezbędne nam do wystawienia później dokumentu sprzedaży i zaadresowania przesyłki;</p>\n</li>\n<li>\n<p>adres (ulica, numer domu/lub numer domu i lokalu, kod pocztowy, województwo i miasto) – niezbędny nam później do zaadresowania przesyłki;</p>\n</li>\n<li>\n<p>e-mail – niezbędny do logowania na stronie www.wloczkiwarmii.pl i komunikacji związanej z korzystaniem ze sklepem internetowym www.wloczkiwarmii.pl</p>\n</li>\n<li>\n<p>numer telefonu – niezbędny w przypadku wyboru niektórych metod dostawy (wymagany przez przewoźników)</p>\n</li>\n</ol>\n<p> </p>\n<p><em><em><u>Dane podane w trakcie rejestracji są przetwarzane wyłącznie przez sklep www.wloczkiwarmii.pl </u></em></em><em><u>i nie są wykorzystywane w żaden inny sposób.</u></em></p>\n<p><br /> </p>\n<p style=\"margin-left:1.25cm;\"><strong>ZŁOŻENIA ZAMÓWIENIA:</strong></p>\n<p style=\"margin-left:1.25cm;\">W trakcie składania zamówienia prosimy o podanie nam danych niezbędnych do realizacji zamówienia, które w przypadku zarejestrowanych i zalogowanych Klientów częściowo pobierane są automatycznie z danych podanych przy rejestracji.</p>\n<p> </p>\n<p><strong>Przy składaniu zamówienia prosimy o podanie:</strong></p>\n<ol>\n<li>\n<p>imię i nazwisko lub nazwa firmy/instytucji – niezbędne do wystawienia dokumentu sprzedaży i zaadresowania przesyłki;</p>\n</li>\n<li>\n<p>adres (ulica, numer domu/lub numer domu i lokalu, kod pocztowy, województwo i miasto) – niezbędny do zaadresowania przesyłki;</p>\n</li>\n<li>\n<p>e-mail – niezbędny do komunikacji związanej z realizacją zamówienia;</p>\n</li>\n<li>\n<p>numer telefonu – niezbędny w przypadku wyboru niektórych metod dostawy (wymagany przez przewoźników).</p>\n</li>\n</ol>\n<p> </p>\n<p><strong>W przypadku, kiedy przy składaniu zamówienia Klient wybierze dostawę na inny adres niż wskazany przy rejestracji lub składaniu zamówienia, prosimy dodatkowo o podanie:</strong></p>\n<ol>\n<li>\n<p>imię i nazwisko lub nazwa firmy/instytucji – niezbędne nam do zaadresowania przesyłki;</p>\n</li>\n<li>\n<p>adres (ulica, numer domu/lub numer domu i lokalu, kod pocztowy, wolewództwo i miasto) – niezbędny do zaadresowania przesyłki;</p>\n</li>\n<li>\n<p>numer telefonu do odbiorcy przesyłki – niezbędny w przypadku wyboru niektórych metod dostawy (wymagany przez przewoźników).</p>\n</li>\n</ol>\n<p> </p>\n<p><strong><strong>W przypadku, kiedy przy składaniu zamówienia Klient wybierze wystawienie dokumentu sprzedaży na inne dane, niż wskazane przy rejestracji lub składaniu zamówienia, prosimy dodatkowo o podanie:</strong></strong></p>\n<ol>\n<li>\n<p>imię i nazwisko lub nazwa firmy/instytucji – niezbędne do wystawienia dowodu sprzedaży;</p>\n</li>\n<li>\n<p>adres (ulica, numer domu/lub numer domu i lokalu, kod pocztowy, województwo i miasto) – niezbędne do wystawienia dowodu sprzedaży;</p>\n</li>\n<li>\n<p>numer NIP – niezbędny do wystawienia dowodu sprzedaży.</p>\n<p> </p>\n<p><strong>SUBSKRYPCJA NEWSLETTERA</strong></p>\n</li>\n</ol>\n<p>W przypadku subskrypcji newslettera oraz wyrażenia dobrowolnej zgody na jego otrzymywanie w procesie rejestracji lub składania zamówienia prosimy jedynie o podanie adresu e-mail, na który przesyłane będę informacje handlowe od Administratora, z których w każdej chwili możesz zrezygnować logując się na swoje konto w sklepie internetowym www.wloczkiwarmii.pl lub anulujący subskrypcję poprzez moduł znajdujący się w dolnej, prawej stronie witryny.</p>\n<p> </p>\n<ol>\n<li>\n<p>Administrator zbiera informacje związane z przeglądaniem zawartości witryny przez użytkowników, takie jak: liczba i źródło wizyt na stronach internetowych witryny, czas wizyty, przeglądane treści, liczba i rodzaj otwieranych podstron, wykorzystane odesłania, adres IP komputera. Administrator nie łączy takich informacji z danymi osobowymi użytkownika i nie wykorzystuje ich do identyfikacji użytkownika, chyba że jest to niezbędne dla prawidłowego świadczenia usługi.</p>\n</li>\n<li>\n<p>Administrator nie przechowuje danych wrażliwych.</p>\n</li>\n</ol>\n<p><br /><strong>III. PRZETWARZANIE DANYCH</strong></p>\n<p><br />3.1 Cele przetwarzania danych osobowych<br />Dane osobowe przetwarzane są w celu:</p>\n<ol>\n<li>\n<p>Realizacji zapytań i zamówień składanych w sklepie internetowym www.wloczkiwarmii.pl, przez wszystkie dostępne kanały komunikacji, a także dochodzenia roszczeń z nimi związanych na podstawie art. 6 ust. 1 lit. b RODO.</p>\n</li>\n<li>\n<p>Marketingu bezpośredniego związanego z prowadzoną działalnością na podstawie art. 6 ust. 1 lit. a RODO, w tym (ale nie wyłącznie) przesyłania informacji handlowych na podany adres e-mail, wykonywania połączeń telefonicznych na wskazany numer, prezentowania ofert promocyjnych w ramach prowadzonych kampanii, przez wszystkie prowadzone kanały sprzedaży.</p>\n</li>\n<li>\n<p>Badania satysfakcji ze współpracy z Administratorem oraz Dystrybutorami lokalnymi na podstawie art. 6 ust. 1 lit. f RODO. Badania mogą odbywać się w sposób elektroniczny z wykorzystaniem ankiet, formularzy lub zapytań poprzez pocztę e-mail lub telefonicznie.</p>\n</li>\n</ol>\n<p>3. 2 Zakres wykorzystania informacji</p>\n<ol>\n<li>\n<p>Administrator wykorzystuje informacje, o których mowa w punkcie 2.2 podpunkt b, wyłącznie w celach związanych z badaniem rynku i ruchu internetowego w ramach witryn, w celach statystycznych, w szczególności dla oceny zainteresowania treściami zamieszczanymi w witrynach oraz ulepszaniem treści witryn.</p>\n</li>\n<li>\n<p>Administrator stosuje pliki typu cookie lub podobne. Pliki tego typu umożliwiają Administratorowi, w szczególności, lepsze dostosowanie witryny internetowej do indywidualnych zainteresowań i preferencji użytkownika.</p>\n<p><strong>PLIKI „COOKIES”</strong></p>\n</li>\n</ol>\n<p>Sklep internetowy www.wloczkiwarmii.pl wykorzystuje technologię „cookies”, czyli plików tekstowych umieszczanych na Twoim urządzeniu, w celu umożliwienia stronie sklepu www.wloczkiwarmii.pl rozpoznania Ciebie i dostosowania do Twoich potrzeb.</p>\n<p>Sklep internetowy www.wloczkiwarmii.pl wykorzystuje cookies do:</p>\n<p>1. zapamiętania zalogowania;</p>\n<p>2. zapamiętania zawartości Twojego koszyka;</p>\n<p>3. zapamiętania Twoich preferencji wyświetlania strony sklepu www.wloczkiwarmii.pl;</p>\n<p>4. tworzenia statystyk i raportów oglądalności funkcjonowania strony sklepu www.wloczkiwarmii.pl.</p>\n<p> </p>\n<p><strong><em>W przypadku, gdy nie zgadzasz się na umieszczanie na swoim urządzeniu plików cookies może zablokować ich umieszczenie odpowiednio konfigurując swoja przeglądarkę internetową. Informacje jak to zrobić znajdziesz w plikach pomocy swojej przeglądarki internetowej. Niestety w przypadku zablokowania plików cookies pochodzących ze strony sklepu www.wloczkiwarmii.pl nie możemy zagwarantować jego poprawnego działania.</em></strong></p>\n<p> </p>\n<p><strong><em>Jeżeli zgadzasz się na umieszczanie na swoim urządzeniu plików cookies, ale po zakończeniu odwiedzin w sklepie www.wloczkiwarmii.pl chciałbyś je skasować, możesz to zrobić bez ryzyka a informację o tym jak, to zrobić znajdziesz w plikach pomocy swojej przeglądarki internetowej.</em></strong></p>\n<p> </p>\n<p><strong>Google Analytics (cookies)</strong></p>\n<p>Google Analytics wykorzystuje technologię „cookies”, czyli plików tekstowych umieszczanych na Twoim urządzeniu, w celu umożliwienia przeanalizowania przez stronę sklepu www.wloczkiwarmii.pl<strong> </strong>źródeł ruchu i sposobu, w jaki odwiedzający korzystają z niego.</p>\n<p>Google gromadzi na swoich serwerach dane pozyskane z umieszczania na urządzeniach plików cookies i korzysta z tych informacji w celu tworzenia raportów i świadczenia innych usług związanych z ruchem i korzystaniem z Internetu.</p>\n<p>Google może również przekazywać te informacje osobom trzecim, jeżeli będzie zobowiązana to uczynić na podstawie przepisów prawa lub w przypadku, gdy osoby te przetwarzają takie informacje w imieniu Google.</p>\n<p> </p>\n<p><em><u>Dane te nie są nigdy łączone z danymi podanymi, o których mowa w punkcie 2.2 i stanowią jedynie materiał do analizy statystycznej i mechanizmów korygowania błędów systemowych.</u></em></p>\n<p> </p>\n<p><strong><em>Jeżeli nie zgadzasz się na umieszczanie na swoim urządzeniu plików cookies może zablokować ich umieszczenie odpowiednio konfigurując swoja przeglądarkę internetową. Informacje jak to zrobić znajdziesz w plikach pomocy swojej przeglądarki internetowej. Niestety w przypadku zablokowania plików cookies Google nie możemy zagwarantować poprawnego działania sklepu internetowego www.wloczkiwarmii.pl.</em></strong></p>\n<p><strong><em>Jeżeli zgadzasz się na umieszczanie na swoim urządzeniu plików cookies Google, ale po zakończeniu odwiedzin w sklepie internetowym www.wloczkiwarmii.pl chciałbyś je skasować, możesz to zrobić bez ryzyka a informację o tym jak to zrobić znajdziesz w plikach pomocy swojej przeglądarki internetowej.</em></strong></p>\n<p> </p>\n<p><strong>Google AdWords (cookies)</strong></p>\n<p>Google AdWords wykorzystuje technologię „cookies”, czyli plików tekstowych umieszczanych na Twoim urządzeniu, w celu umożliwienia przez sklep internetowy www.w<strong>loczkiwarmii.pl</strong><strong> </strong>oceny poprawności i skuteczności prowadzonej działalności reklamowej z wykorzystaniem sieci AdWords.</p>\n<p>Google gromadzi na swoich serwerach dane pozyskane z umieszczania na urządzeniach plików cookies i korzysta z tych informacji w celu tworzenia raportów i świadczenia innych usług związanych z ruchem i korzystaniem z internetu.</p>\n<p>Google może również przekazywać te informacje osobom trzecim, jeżeli będzie zobowiązana to uczynić na podstawie przepisów prawa lub w przypadku, gdy osoby te przetwarzają takie informacje w imieniu Google.</p>\n<p> </p>\n<p><em><u>Dane te nie są nigdy łączone z danymi podanymi, o których mowa w punkcie 2.2 i stanowią jedynie materiał do analizy statystycznej i mechanizmów korygowania błędów systemowych.</u></em></p>\n<p> </p>\n<p><strong><em>Jeżeli nie zgadzasz się na umieszczanie na swoim urządzeniu plików cookies może zablokować ich umieszczenie odpowiednio konfigurując swoja przeglądarkę internetową. Informacje jak to zrobić znajdziesz w plikach pomocy swojej przeglądarki internetowej. Niestety w przypadku zablokowania plików cookies Google nie możemy zagwarantować poprawnego działania strony sklepu internetowego www.wloczkiwarmii.pl.</em></strong></p>\n<p> </p>\n<p><strong><em>Jeżeli zgadzasz się na umieszczanie na swoim urządzeniu plików cookies Google, ale po zakończeniu odwiedzin w sklepie internetowym www.wloczkiwarmii.pl chciałbyś je skasować, możesz to zrobić bez ryzyka a informację o tym jak to zrobić znajdziesz w plikach pomocy swojej przeglądarki internetowej.</em></strong></p>\n<p><br />3. 3 Profilowanie</p>\n<ol>\n<li>\n<p>Administrator nie wykorzystuje profilowania opartego o dane osobowe.</p>\n</li>\n<li>\n<p>Administrator nie podejmuje zautomatyzowanych decyzji wynikających z profilowania opartego o dane osobowe.</p>\n</li>\n</ol>\n<p><br />3.4 Okres przetwarzania danych osobowych</p>\n<ol>\n<li>\n<p>Okres przetwarzania danych osobowych zależy od czasu wycofania udzielonych zgód.</p>\n</li>\n<li>\n<p>Możliwe jest przedłużenie przetwarzania danych osobowych do czasu wypełnienia prawnie uzasadnionych interesów Administratora, w tym realizacji umów lub zabezpieczenia ewentualnych roszczeń. Nie oznacza to możliwości przetwarzania danych osobowych w innych celach niż wymieniony.</p>\n</li>\n</ol>\n<p><strong>IV. BEZPIECZEŃSTWO DANYCH</strong></p>\n<p> </p>\n<p>4.1 Przetwarzając Twoje dane osobowe stosujemy środki organizacyjne i techniczne zgodne z właściwymi przepisami prawa, w tym stosujemy szyfrowanie połączenia za pomocą certyfikatu SSL.</p>\n<p><br /><strong>V. ODBIORCY DANYCH</strong><br /><br />5.1<strong> </strong>Administrator oświadcza, że nie sprzedaje i nie udostępnia zgromadzonych danych osobowych podmiotom niezwiązanym z realizacją umów.<br /><br />5.2 Powierzenie danych osobowych następuje w oparciu o umowę powierzenia, zapewniającą ochronę danych osobowych zgodnie z obowiązującymi przepisami.<br /><br />5.3 Dane osobowe mogą zostać ujawnione podmiotom współpracującym w związku z realizacją i wykonywaniem praw wynikających z umów w tym, ale nie wyłącznie, podmiotom świadczącym usługi:</p>\n<ul>\n<li>\n<p>księgowe</p>\n</li>\n<li>\n<p>informatyczne</p>\n</li>\n<li>\n<p>marketingowe</p>\n</li>\n<li>\n<p>kurierskie i pocztowe</p>\n</li>\n<li>\n<p>prawne</p>\n</li>\n<li>\n<p>zaplecza administracyjnego</p>\n</li>\n<li>\n<p>hostingowe</p>\n</li>\n<li>\n<p>dostawca systemu mailingowego</p>\n</li>\n<li>\n<p>dostawca płatności</p>\n</li>\n</ul>\n<p><br />5.5 Administrator nie przekazuje danych osobowych poza obszar Unii Europejskiej, z wyjątkiem sytuacji, gdy wymaga tego konkretne żądanie ze strony klienta związane z realizacją zamówienia.<br /><br />5.6 Administrator zastrzega sobie prawo ujawnienia informacji dotyczących użytkownika właściwym organom bądź osobom trzecim, które zgłoszą żądanie udzielenia takich informacji, w oparciu o odpowiednią podstawę prawną oraz zgodnie z przepisami obowiązującego prawa.</p>\n<p><br /><strong>VI. PRAWA ZWIĄZANE Z PRZETWARZANIEM DANYCH OSOBOWYCH</strong><br /><br />6.1 Osobie, której dane osobowe są przetwarzane, przysługuje:</p>\n<ul>\n<li>\n<p>prawo do wycofania zgody na przetwarzanie danych osobowych</p>\n</li>\n<li>\n<p>prawo do sprzeciwu wobec przetwarzania danych w celach marketingowych</p>\n</li>\n<li>\n<p>prawo dostępu do danych</p>\n</li>\n<li>\n<p>prawo żądania sprostowania danych osobowych</p>\n</li>\n<li>\n<p>prawo żądania usunięcia danych osobowych</p>\n</li>\n<li>\n<p>prawo żądania ograniczenia przetwarzania danych osobowych</p>\n</li>\n<li>\n<p>prawo do przenoszenia danych osobowych</p>\n</li>\n</ul>\n<p><br />6.2 Osobie, której dane są przetwarzane, przysługuje prawo do wniesienia skargi do organu nadzorczego zajmującego się ochroną danych osobowych, tj. Prezesa Urzędu Ochrony Danych Osobowych.<br /><br />6.3 Kontakt związany z ochroną danych osobowych w sklepie internetowym www.włóczkiwarmii.pl</p>\n<p> </p>\n<ul>\n<li>\n<p>telefonicznie: + 48 602 735 745</p>\n</li>\n<li>\n<p>drogą elektroniczną na adres e-mail: kontakt@wloczkiwarmii.pl</p>\n</li>\n<li>\n<p>listownie na adres firmy z dopiskiem „Dane osobowe”</p>\n</li>\n</ul>\n<p><br />6.2 Administrator może odmówić usunięcia danych osobowych, jeżeli istnieją przesłanki wynikające z przepisów prawa.<br /><br /><strong>VII. POSTANOWIENIA KOŃCOWE</strong></p>\n<p><br /> </p>\n<p>7.1 Niniejsza polityka jest dostępna na stronie sklepu internetowego pod adresem <a href=\"http://wloczkiwarmii.pl/index.php?route=information/information&amp;information_id=3\">http://wloczkiwarmii.pl/index.php?route=information/information&amp;information_id=3</a>.</p>\n<p><br /> </p>\n<p>7.2 Administrator zastrzega sobie prawo do zmian w Polityce Prywatności. Każdego użytkownika korzystającego z usług Administratora obowiązuje aktualna wersja Polityki Prywatności</p>','polityka-prywatnosci'),(3,2,1,'Terms and conditions of use','','Our terms and conditions of use','conditions, terms, use, sell','<h1 class=\"page-heading\">Terms and conditions of use</h1>\n<h3 class=\"page-subheading\">Rule 1</h3>\n<p class=\"bottom-indent\">Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna a