trong></p>\n<p>           Włóczki Warmii Joanna Skiba - Michalewska<br />           ul. Bolesława Laszki 7/38, 10-687 Olsztyn<br />           NIP 7393447195<br />           Regon 280112621</p>\n<p style=\"margin-left:1.25cm;\">tytuł przelewu: <strong>podaj numer zamówienia</strong></p>\n<p style=\"margin-left:1.25cm;\"> </p>\n<h4><u><strong>PŁATNOŚĆ W EUR:</strong></u></h4>\n<h6 style=\"margin-left:1.25cm;\"> </h6>\n<p style=\"margin-left:1.25cm;\">właściciel: <strong>WŁÓCZKI WARMII Joanna Skiba-Michalewska</strong></p>\n<p style=\"margin-left:1.25cm;\">mBank: <strong>PL46 1140 2004 0000 3712 0662 7006&lt;/strong &gt;<br />KOD SWIFT (BIC): <strong>BREXPLPWMBK</strong> </strong></p>\n<p style=\"margin-left:1.25cm;\">tytuł przelewu: <strong>podaj numer zamówienia</strong></p>\n<p style=\"margin-left:1.25cm;\"> </p>\n<p> </p>\n<h4><strong>2) Wysyłka za pobraniem - za zakupy zapłacisz przy odbiorze listonoszowi lub kurierowi.</strong></h4>\n<p> </p>\n<h4><strong>3) Płatność za pośrednictwem PayPal</strong></h4>','platnosci'),(5,2,1,'Secure payment','','Our secure payment method','secure payment, ssl, visa, mastercard, paypal','<h2>Secure payment</h2>\n<h3>Our secure payment</h3>\n<p>With SSL</p>\n<h3>Using Visa/Mastercard/Paypal</h3>\n<p>About this service</p>','secure-payment'),(6,1,1,'Reklmacje I Zwroty','','','reklamacje, zwroty','<p>Szanowny Kliencie, jeżeli znalazłeś się na tej stronie, oznacza to, że najprawdopodobniej coś poszło nie tak w realizacji zamówienia i nie jesteś zadowolony z dokonanego zakupu.<br /><br />Nie ma jednak powodów do zdenerwowania! Nasza firma szanuje Twoje prawa. Poniżej zamieściliśmy informacje, które pozwolą Ci szybko i wygodnie złożyć reklamację lub dokonać zwrotu towaru w ramach odstąpienia od umowy.<br /><br /><br />1) INFORMACJE DOTYCZĄCE KORZYSTANIA Z PRAWA ODSTĄPIENIA OD UMOWY<br /><br />Zgodnie z aktualnymi przepisami prawnymi, mają Państwo prawo odstąpić od niniejszej umowy w terminie 14 dni bez podania jakiejkolwiek przyczyny.<br /><br />Termin do odstąpienia od umowy wygasa po upływie 14 dni od dnia w którym weszli Państwo w posiadanie rzeczy lub w którym osoba trzecia inna niż przewoźnik i wskazana przez Państwa weszła w posiadanie rzeczy.<br /><br />Aby skorzystać z prawa odstąpienia od umowy, muszą Państwo poinformować nas WŁÓCZKI WARMII Joanna Skiba-Michalewska; ul. B. Laszki 7/38, 10-687 Olsztyn o swojej decyzji o odstąpieniu od niniejszej umowy w drodze jednoznacznego oświadczenia (na przykład pismo wysłane pocztą, faksem lub pocztą elektroniczną).<br /><br />Mogą Państwo skorzystać z wzoru formularza odstąpienia od umowy, jednak nie jest to obowiązkowe. Formularze do pobrania w formatach: <span style=\"font-size:14px;\"><a href=\"/forms/formularz-odstapienie-oraz-informacja.pdf\"><span style=\"color:#0000ff;\">pdf</span></a></span>, <span style=\"font-size:14px;\"><a href=\"/forms/formularz-odstapienie-oraz-informacja.doc\"><span style=\"color:#0000ff;\">doc</span></a></span>.<br /><br />Aby zachować termin do odstąpienia od umowy, wystarczy, aby wysłali Państwo informację dotyczącą wykonania przysługującego Państwu prawa odstąpienia od umowy przed upływem terminu do odstąpienia od umowy.<br /><br />W przypadku odstąpienia od niniejszej umowy zwracamy Państwu wszystkie otrzymane od Państwa płatności, w tym koszty dostarczenia rzeczy (z wyjątkiem dodatkowych kosztów wynikających z wybranego przez Państwa sposobu dostarczenia innego niż najtańszy zwykły sposób dostarczenia oferowany przez nas), niezwłocznie, a w każdym przypadku nie później niż 14 dni od dnia, w którym zostaliśmy poinformowani o Państwa decyzji o wykonaniu prawa odstąpienia od niniejszej umowy. Zwrotu płatności dokonamy przy użyciu takich samych sposobów płatności, jakie zostały przez Państwa użyte w pierwotnej transakcji, chyba że wyraźnie zgodziliście się Państwo na inne rozwiązanie - w każdym przypadku nie poniosą Państwo żadnych opłat w związku z tym zwrotem.<br /><br />Możemy wstrzymać się ze zwrotem płatności do czasu otrzymania rzeczy lub do czasu dostarczenia nam dowodu jej odesłania, w zależności od tego, które zdarzenie nastąpi wcześniej.<br /><br />Proszę odesłać lub przekazać nam rzecz niezwłocznie, a w każdym razie nie później niż 14 dni od dnia, w którym poinformowali nas Państwo o odstąpieniu od niniejszej umowy. Termin jest zachowany, jeżeli odeślą Państwo rzecz przed upływem terminu 14 dni.<br /><br />Będą Państwo musieli ponieść bezpośrednie koszty zwrotu rzeczy.<br /><br />Odpowiadają Państwo tylko za zmniejszenie wartości rzeczy wynikające z korzystania z niej w sposób inny niż było to konieczne do stwierdzenia charakteru, cech i funkcjonowania rzeczy.<br /><br /><br />2) INFORMACJE DOTYCZĄCE OŚWIADCZENIA O SKORZYSTANIU Z RĘKOJMI PRZEZ KONSUMENTA (REKLAMACJE)<br /><br />Zgodnie z obowiązującymi przepisami, ponosimy wobec Państwa odpowiedzialność na zasadach określonych w Kodeksie cywilnym za wady fizyczne i prawne.<br /><br />Macie Państwo po wykryciu wady prawo:<br /><br />    złożyć oświadczenie o żądaniu obniżenia ceny;<br />    złożyć oświadczenie o odstąpieniu od umowy, ale nie wtedy kiedy wada jest nieistotna;<br />    żądać wymiany rzeczy na wolną od wad;<br />    żądać usunięcia wady.<br /><br />W ciągu 14 dni ustosunkujemy się do Państwa oświadczenia lub żądania.<br /><br />Jesteście Państwo zobowiązani dostarczyć rzecz wadliwą na nasz koszt na adres: WŁÓCZKI WARMII Joanna Skiba-Michalewski; ul. B. Laszki 7/38, 10-687 Olsztyn, a jeżeli dostarczenie rzeczy przez Państwo byłoby nadmiernie utrudnione (np. ze względu na rodzaj rzeczy lub sposób jej zamontowania) obowiązani jesteście udostępnić nam rzecz w miejscu, w którym się znajduje.<br /><br />Koszty wymiany lub naprawy ponosi my, za wyjątkiem przypadku, jeżeli rzecz wadliwa została zamontowana. Wtedy zobowiązani jesteście Państwo ponieść część związanych z tym kosztów przewyższających cenę rzeczy. Macie Państwo alternatywnie prawo żądać od nas zapłaty części kosztów demontażu i ponownego zamontowania, ale do wysokości ceny rzeczy sprzedanej.<br /><br />Odpowiadamy z tytułu rękojmi jeśli wada fizyczna zostanie stwierdzona przed upływem dwóch lat od momentu wydania Państwu rzeczy, a jeżeli przedmiotem sprzedaży była rzecz używana roku od momentu jej wydania. Państwa uprawnienie jest ograniczone w czasie do roku, licząc od dnia stwierdzenia wady jednak nie upływa wcześniej niż przed upływem dwóch lat od momentu wydania Wam rzeczy, a jeżeli przedmiotem sprzedaży była rzecz używana przed upływem roku od momentu wydania Wam rzeczy. Wyjątkiem jest sytuacja kiedy określony przez nas lub producenta termin przydatności rzeczy do użycia kończy się po upływie dwóch lat od momentu wydania Wam rzeczy. Odpowiadamy wtedy z tytułu rękojmi za wady fizyczne tej rzeczy stwierdzone przed upływem tego terminu.<br /><br />Odpowiedzialność za wady prawne jest w istocie taka sama, a czas na zgłoszenie biegnie od momenty dowiedzenia się o wadzie, a okresy przedawnienia od uprawomocnienia się orzeczenia w sprawie rzeczy dotkniętej wadą prawną.<br /><br />Zagadnienie rękojmi jest niezwykle złożone i zachęcamy do zapoznania się z Kodeksem cywilnym i stronami UOKiK i organizacji konsumenckich opisujących dokładnie i obrazowa Państwa uprawnienia. Nasz sklep działa w zgodzie z prawem i szanuje prawa konsumentów, więc informacje prawne, które tam znajdziecie będą również miały zastosowanie w zakresie umów<br />z nami.</p>\n<p>Formularze do pobrania w formatach: <span style=\"font-size:14px;\"><a href=\"/forms/formularz-rekojma-oraz-informacja.pdf\"><span style=\"color:#0000ff;\">pdf</span></a></span>, <span style=\"font-size:14px;\"><a href=\"/forms/formularz-rekojma-oraz-informacja.doc\"><span style=\"color:#0000ff;\">doc</span></a></span>.<br /><br />Zachęcamy do zadawania wszelkich pytań na adres: <a href=\"mailto:kontakt@wloczkiwarmii.pl?subject=Reklamacje%20i%20zwroty\">kontakt@wloczkiwarmii.pl</a></p>','reklmacje-i-zwroty'),(6,2,1,'Reklmacje I Zwroty','','','','','reklmacje-i-zwroty'),(7,1,1,'Rabaty','','','','<p><span style=\"font-size:16px;\"><strong>5 % RABATU NA KOLEJNE ZAKUPY</strong><br /><br />Doceniamy stałych Klientów - u nas zawsze dostaniesz 5% rabatu za zakupy do wykorzystania w przyszłym zamówieniu. Aby skorzystać z rabatu wystarczy założyć konto w naszym sklepie i dokonywać zakupów po zalogowaniu. Jeśli masz już u nas konto, twoje zamówienia również będą rabatowane.<br /><br />Za każde zamówienie dokonane w sklepie i opłacone za pomocą przelewu24 lub przelewu tradycyjnego,  otrzymasz 5% rabatu od wartości złożonego zamówienia, do wykorzystania przy następnych zakupach. Kwota rabatu wygeneruje się automatycznie w momencie, kiedy status zamówienia zmieni się na WYSŁANE. Dzięki temu na koncie klienta w zakładce MOJE RABATY pojawi się opcja - PRZEKSZTAŁĆ MOJE PUNKTY NA BON O WARTOŚCI .....zł (zielony przycisk).  Po kliknięciu tej opcji otrzymujemy specjalny kod rabatowy. Aby wykorzystać kod, wystarczy, że w trakcie kolejnych zakupów wpiszemy kod do okienka w koszyku, klikniemy DODAJ, a zamówienie zostanie pomniejszone o zebraną kwotę. Zebrane rabaty można użyć od razu lub wykorzystać w kolejnych zamówieniach. </span><span style=\"font-size:16px;\">Każdy kod zachowuje swoją ważność przez ROK.</span><br />Aktualnie posiadane środki możesz sprawdzić w zakładce TWOJE KONTO / MOJE RABATY /. Rabatem są również objęte produkty promocyjne, przecenione lub o obniżonych cenach w trakcie czasowych akcji promocyjnych.</p>','rabaty'),(7,2,1,'Rabaty','','','','','rabaty'),(8,1,1,'Formularze','','','','<p>1. <a href=\"/forms/formularz-odstapienie-oraz-informacja.pdf\">wzór </a>oświadczenia o odstąpieniu od umowy (§4.3)</p>\n<p>2. <a href=\"/forms/formularz-rekojma-oraz-informacja.pdf\">wzór</a> o: żądaniu obniżenia ceny (§5.4.a), odstąpieniu od umowy<br />(§5.4.b), żądaniu wymiany rzeczy na wolną od wad (§5.7.a) i żądania usunięcia wady<br />(§5.7.b)</p>','formularze'),(8,2,1,'Formularze','','','','','formularze');
